const myImage = new Image();
myImage.src =
  "data:image/jpeg;base64,";
myImage.addEventListener("load", function () {
  const canvas = document.getElementById("canvas1");
  const ctx = canvas.getContext("2d");
  canvas.width = window.innerWidth;
  canvas.height = window.innerHeight;
  const imgWidth = canvas.height / (myImage.height / myImage.width);
  const imgHeight = canvas.height;
  class Particle {
    constructor(effect, x, y, color) {
      this.effect = effect;
      //Starting Pixel Position
      this.x = Math.random() * this.effect.width;
      this.y = Math.random() * this.effect.height;
      //Image Pixel Position
      this.originX = Math.floor(x);
      this.originY = Math.floor(y);
      this.color = color;
      //Size of one particle
      this.size = this.effect.resolution;
      //Velocity and direction of Particles
      this.vx = 0;
      this.vy = 0;
      //Smooth
      this.ease = 0.2;
      this.friction = 0.9;
      this.dx = 0;
      this.dy = 0;
      this.distance = 0;
      this.force = 0;
      this.angle = 0;
    }
    draw(context) {
      context.fillStyle = this.color;
      context.fillRect(this.x, this.y, this.size, this.size);
    }
    update() {
      this.dx = this.effect.mouse.x - this.x;
      this.dy = this.effect.mouse.y - this.y;
      this.distance = this.dx * this.dx + this.dy * this.dy;
      this.force = -this.effect.mouse.radius / this.distance;

      if (this.distance < this.effect.mouse.radius) {
        this.angle = Math.atan2(this.dy, this.dx);
        this.vx += this.force * Math.cos(this.angle);
        this.vy += this.force * Math.sin(this.angle);
      }

      this.x += (this.vx *= this.friction) + (this.originX - this.x) * this.ease;
      this.y += (this.vy *= this.friction) + (this.originY - this.y) * this.ease;
    }
    warp() {
      this.x = Math.random() * this.effect.width;
      this.y = Math.random() * this.effect.height;
      this.ease = 0.3;
    }
  }

  class Effect {
    constructor(width, height) {
      this.width = width;
      this.height = height;
      this.particlesArray = [];
      this.centerX = this.width / 2;
      this.centerY = this.height / 2;
      this.x = this.centerX - imgWidth * 0.5;
      this.y = this.centerY - imgHeight * 0.5;
      //Resolution of Image
      this.resolution = 2;
      //Mouse Position
      this.mouse = {
        radius: 10000,
        x: undefined,
        y: undefined,
      };
      window.addEventListener("mousemove", (event) => {
        this.mouse.x = event.x;
        this.mouse.y = event.y;
      });
    }
    init(context) {
      context.drawImage(myImage, this.x, this.y, imgWidth, imgHeight);
      const pixels = context.getImageData(0, 0, this.width, this.height).data;
      for (let y = 0; y < this.height; y += this.resolution) {
        for (let x = 0; x < this.width; x += this.resolution) {
          const index = (y * this.width + x) * 4;
          const red = pixels[index];
          const green = pixels[index + 1];
          const blue = pixels[index + 2];
          const alpha = pixels[index + 3];
          const color = `rgb(${red},${green},${blue})`;

          if (alpha > 0) {
            this.particlesArray.push(new Particle(this, x, y, color));
          }
        }
      }
    }
    draw(context) {
      this.particlesArray.forEach((particle) => particle.draw(context));
    }
    update() {
      this.particlesArray.forEach((particle) => particle.update());
    }
    warp() {
      this.particlesArray.forEach((particle) => particle.warp());
    }
  }

  const effect = new Effect(canvas.width, canvas.height);
  effect.init(ctx);

  function animate() {
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    effect.draw(ctx);
    effect.update();
    requestAnimationFrame(animate);
  }
  animate();

  //Warp Button
  const warpButton = document.getElementById("warpButton");
  warpButton.addEventListener("click", function () {
    effect.warp();
  });
});

